INSERT INTO `cache_filter` (`cid`, `data`, `expire`, `created`, `headers`, `serialized`) VALUES ('2:0933733a16095c42c3566ed6fe4086d7','<p>Logo designed for the Iberoamerican Leadership Congress 2011, held in Puerto Rico. </p>\n',1303176585,1303090185,'',0),('2:006f3888514743d13d0e7d7739cddb58','<p>Logo designe for AIESEC Puerto Rico&#39;s talent management team. </p>\n',1303176585,1303090185,'',0),('2:5e2ee96006e4ed4cac5103e3575253b8','<p>Series of posters to promote internships.</p>\n<p>Through these posters, designed for a campaign to promote internation internships in education. The material was designed to draw viewers attention thru the use of pictures, BIG NICE GOOD pictures. The idea was to lure thru the seductivness of the international imagery. Taking the images as the most important element in the design, the typography, it&#39;s messages, and the institutional branding were designed acordingly.</p>\n',1303176585,1303090185,'',0),('2:51c4696343c447f360d4641f91859a28','<h2><em>This is the portfolio site of Jorge Silva.&nbsp;</em></h2>\n<p>Here you&#39;ll find all types of work including logos, posters and websites.&nbsp;</p>\n<p>Jorge Silva has knowledge different programs such as <em>Photoshop</em> and <em>Illustrator</em> and knowledge of how to build the web by <em>HTML, CSS, Flash( unfortunately, for such a firm believer in standards</em><em>), &nbsp;PHP, </em>&nbsp;and trough different CMSs like (<em>Wordpress, Joomla, Drupal</em>).&nbsp;</p>\n<p>His design style aspires always to be <em><span style=\"color: rgb(105, 105, 105);\">simple</span></em>, convinced of the power of simple solutions to problems in design.</p>\n',1302285497,1302199097,'',0),('2:725cbe8711489bbdaa610556d8078666','<p>This website was done for a the Chatka Summer camp.</p>\n<p>The site is a very simple site, done over a year ago. The site is a basic presentation site for the camp. Because of this a very simple layout was used. The design was a combination of a redesign, taking some of the features used in the previous site and new ideas. The aesthethics of the site reference the camp brand and logo (dark yellos, light browns) while making use of the &#39;outdoors&#39; present in previous design and very portinent for this type of summer camp.</p>\n',1302115613,1302029213,'',0),('2:43169fc028bbb3447f7f5212c719f0fd','<p>Logo designed for the Iberoamerican Leadership Congress 2011, held in Puerto Rico. </p>\n<p>The logo was designed with the utmost simplicity in mind. The logo consists in only one line that contructs the whole logo (and idea also develpod in another proyect). The typography surrounds the logo, to keep up with it&#39;s linear form. The &quot;garita&quot; was used as a way to give a visual representation to a conference based on the very abstract notion of &#39;leadership&#39; (hard to represent visually), using the national symbol instead.</p>\n',1302147301,1302060901,'',0),('2:2c61aa0fdc73f728de4dd47a02963f36','<p>Website done for InterLeacroft, a proyect established in 2009 to launch and promote the Romanization of Intellectual Property.</p>\n<p>For this emerging and daring undertaking, a website was created to showcase and present the institution and it&#39;s ideas. As such, the sites presents what the institution does, serves as a platform for trainings and courses and for spreading the ideas of this proposition thru the intituion&#39;s blog.</p>\n',1302115613,1302029213,'',0),('1:5dd931678eda3df64799baf7b3b698ac','<p><a href=\"http://cc-im-application.thejsj.com/\">Visit Site</a></p>\n',1302115613,1302029213,'',0),('2:d572cb09df3d9b2b53bfd140d955f881','<p>Site designed for the Iberoamerican Leadership Congress 2011 held in Puerto Rico.</p>\n<p>The site as designed mostly as a portal for information related to the congress. This is mainly a content site and was designed accordingly (through it&#39;s horizontallity, through it&#39;s white background and typography). The experience is designed for the user to read. Social Media was also integrated to promote the congress among it&#39;s visitros.</p>\n',1302115613,1302029213,'',0),('2:fe83770dde0e332b7b1552fb339ece14','<p>Website for musician/writer Noel Davila.</p>\n<p>After Noel Davila&#39;s frustration with his very busy webmaster, I CMS and redesign was done for noeldavila.net. The very simple and user friendly Wordpress was used to provide a solution that would empower the user to manage his own content, instead of relying on a designer. This Wordpress instaltion provides the capabilites for download management, social media channels management, quotes and Latests News.</p>\n',1302115613,1302029213,'',0),('2:044a84e32971a864c72541b3682e6bfa','<p>Series of posters done to promote internships.</p>\n<p>Three posters were designed to promote diffrent types of international internship experiences (Working with NGO&#39;s, youth empowerment programs and cultural ambassadorship programs). It was important to design a series of poster 1. Explaining all three diffrent types of internships and 2. to keep up with the organization&#39;s branding (AIESEC). This was achieved thru the use of template in which the changing elements were given more attention thru positioning, typography and color. An angled spacial organization was also used to bring tension and attention to poster.</p>\n',1302023365,1301936965,'',0),('2:35ae51407f626302e9053c48ff7e478f','<p>Logo designe for AIESEC Puerto Rico&#39;s talent management team. </p>\n<!--break--><!--break-->\n<p>The Talent Management Team inside this organization (AIESEC) is responsible for dealign with providing the correct experience for all members. Taking the the team&#39;s role in the organization, a logo was designed taking in the idea of &#39;building&#39; and the &#39;sum of the parts&#39; to give the entity an aesthetically pleasing image. Simple elementary colors were used to denote the contrast of the forms, while empathizing the structural unity (related to the idea of the organizational unity the entity itends to provide). Lastly, a very expressive but clear typograhpy was used to balance the rest of the composition.</p>\n',1302023365,1301936965,'',0),('2:aa7f12841d8e41434f50cd29472cff19','<p>Logo designed for the Iberoamerican Leadership Congress 2011, held in Puerto Rico. </p>\n<!--break--><!--break-->\n<p>The logo was designed with the utmost simplicity in mind. The logo consists in only one line that contructs the whole logo (and idea also develpod in another proyect). The typography surrounds the logo, to keep up with it&#39;s linear form. The &quot;garita&quot; was used as a way to give a visual representation to a conference based on the very abstract notion of &#39;leadership&#39; (hard to represent visually), using the national symbol instead.</p>\n',1302023365,1301936965,'',0),('2:5b92c5e65ab71e46c924a785b2661f95','<p>One-page website, done as an application.</p>\n<p>For a personal application, a simple one-page website was done with simple HTML ana CSS. The site showcased very simple solid design utilizing some CSS3 technology and the Google Fonts API. The visual aspect of every detail was given very special attention to balance the simplicty of the site with the amount of content and good visual presentation.</p>\n',1302023365,1301936965,'',0),('2:7e75de2110c383739414f329a2167d90','<p>This website was done for a the Chatka Summer camp.</p>\n<p>The site is a very simple site, done over a year ago. The site is a basic presentation site for the camp. Because of this a very simple layout was used. The design was a combination of a redesign, taking some of the features used in the previous site and new ideas. The aesthethics of the site reference the camp brand and logo (dark yellos, light browns) while making use of the &#39;outdoors&#39; present in previous design and very portinent for this type of summer camp.</p>\n<p>The site employs Jquery technology for galleries and tabs, animated GIFS for the menus, Flickr embeddeds and simple HTML.</p>\n',1301958394,1301871994,'',0),('2:1df4ce29a6d48b584adf2423cc9f951b','<p><a href=\"http://chatkacamp.org\">Visit Site</a></p>\n',1301958394,1301871994,'',0),('2:c1b9aab3c7702a40da3266a847d1c978','<p>Logo designe for AIESEC Puerto Rico&#39;s talent management team. </p>\n<p>The Talent Management Team inside this organization (AIESEC) is responsible for dealign with providing the correct experience for all members. Taking the the team&#39;s role in the organization, a logo was designed taking in the idea of &#39;building&#39; and the &#39;sum of the parts&#39; to give the entity an aesthetically pleasing image. Simple elementary colors were used to denote the contrast of the forms, while empathizing the structural unity (related to the idea of the organizational unity the entity itends to provide). Lastly, a very expressive but clear typograhpy was used to balance the rest of the composition.</p>\n',1302023344,1301936944,'',0),('2:145942b5fe35c943052f885ec871bfdd','<p>Logo done for <a href=\"http://www.aiesec.org/cms/aiesec/AI/Iberoamerica/PUERTO%20RICO/Estudiantes_y_Graduados/Internados_Profesionales/index.html\">AIESEC Ro Piedras&#39;</a> exchange team.</p>\n<p>The logo was designed as a way to give an image to a tean inside the organization that focuses on arranging internships and exchange participants from all over the wold. While utilizing intricate forms and shapes, the simplest pallette was used. The logo has a &#39;rugged&#39; feel, balanced by it&#39;s outline that orders and balances the rest of the composition.</p>\n',1301862536,1301776136,'',0),('2:e48c66ce9302031230bb2aca3ceb4122','<p>Series of posters to promote internships.</p>\n<p>Through these posters, designed for a campaign to promote internation internships in education. The material was designed to draw viewers attention thru the use of pictures, BIG NICE GOOD pictures. The idea was to lure thru the seductivness of the international imagery. Taking the images as the most important element in the design, the typography, it&#39;s messages, and the institutional branding were designed acordingly.</p>\n<p>A lot of attention was addressed towards the relationships between all the diffrente materials. Thru the format and typography, the similarities were empathized. Thru the colors and some spacial accomodations the diffrences were rescued.</p>\n',1301827003,1301740603,'',0),('2:d6261e468b31046d4ef8deab1f6b53ef','<p>Website done for InterLeacroft, a proyect established in 2009 to launch and promote the Romanization of Intellectual Property.</p>\n<p>For this emerging and daring undertaking, a website was created to showcase and present the institution and it&#39;s ideas. As such, the sites presents what the institution does, serves as a platform for trainings and courses and for spreading the ideas of this proposition thru the intituion&#39;s blog.</p>\n<p>In terms of design, the image of the instituion was considered at all times. The pallette and typography utilized, both in the website and in the logo, serve to show the balance between the innovation inspired by what the proyect proposes and the formality intertwined in the legal tradition.</p>\n<p>The site was created utilizing Joomla CMS technology. The technical part of the proyect was an challenge considering the necesity of having a website available in both English and Spanish. Also the site is integrated to PayPal for some e-comerece features requested by the client to book Training and enable the selling of a book.</p>\n',1301785201,1301698801,'',0),('2:d8cca87fea7bc5052cd22fad2df17c81','<p><a href=\"http://thejsj.com/ilc3/\">Visit Site</a></p>\n',1301755781,1301669381,'',0),('1:19ff2fc672abf4167ee3ef26e50586d0','<p>Logo done for AIESEC Ro Piedras local commitee.This logo was designed with the idea of a single line constituting the whole logo. At the same time, the logo appears and disappears. The whole logo shows itself through the discountinuity of a line, and the whole image of the organisation through this ephemerality.Since the organization is constituted by students of the University of Puerto Rico, the image of the tower was used as a way to give an image through this emblamtic building, often used to represent the university. Nevertheless, through the use of a diffrent, simpler, aesthetic the use of this architectural element was graspped by organization, instead of bein just a mere duplicate of the university&#39;s image..</p>\n',1301756292,1301669892,'',0),('2:884280925a2a5176ff262da04f1f850c','<p><a href=\"http://noeldavila.net\">Visit Site</a></p>\n',1301755781,1301669381,'',0),('2:00b5fae2d8a9e093c37f64de399b4216','<p>Site designed for the Iberoamerican Leadership Congress 2011 held in Puerto Rico.</p>\n<p>The site as designed mostly as a portal for information related to the congress. This is mainly a content site and was designed accordingly (through it&#39;s horizontallity, through it&#39;s white background and typography). The experience is designed for the user to read. Social Media was also integrated to promote the congress among it&#39;s visitros.</p>\n<p>The design is based on the previous logo design. The pallette utilizes diffrent&nbsp;flavos of&nbsp;blue to contrast elements in the page. Also diffrent shades of gray were used and incoporated almost as a fade of the dominant blue background. This type of light gray was used mostly to differentiate diffrent spaces in the page. The menu typography is also very intresting in how it was utilized as a way to mark both, the professional aspect of the conferencas as well as the youth of it&#39;s participants.</p>\n<p><span style=\"color: rgb(105, 105, 105);\"><em>This site will be launched very shortly and is on the final stages of it&#39;s design.</em></span></p>\n',1301755781,1301669381,'',0),('1:d41d8cd98f00b204e9800998ecf8427e','',1301755781,1301669381,'',0),('2:cdfaf923f882d64573f4181a06873b5d','<p>Website for musician/writer Noel Davila.</p>\n<p>After Noel Davila&#39;s frustration with his very busy webmaster, I CMS and redesign was done for noeldavila.net. The very simple and user friendly Wordpress was used to provide a solution that would empower the user to manage his own content, instead of relying on a designer. This Wordpress instaltion provides the capabilites for download management, social media channels management, quotes and Latests News.</p>\n<p>The chance was taken to perform a redesign on the website. The site is now much more user friendly than the previous design and much more aesthetically pleasing. The colors yellow, black and grey were used to denote contrats and degrees of importance in the page.</p>\n<p><span style=\"color: rgb(105, 105, 105);\"><em>This site is still in the design process. It will be launched January 2011, by request of the client.</em></span></p>\n',1301755781,1301669381,'',0),('2:80bcb4a841e30dcbdfe31b006fc71560','<p>&quot;No art, however minor, demands less than total dedication if you want to excel in it&quot;</p>\n',1301755781,1301669381,'',0),('1:74f7c0570f7eb79dcf2fd52378b44acf','<p><a href=\"\">Visit Site</a></p>\n',1301755781,1301669381,'',0),('1:ee13f63a8037abd712c8b4ffcf3934f8','<p><a href=\"http://thejsj.com/portfolio_old/\">Visit Site</a></p>\n',1301755781,1301669381,'',0),('2:5c37c617ff7a2b8a43b8c7ccb2a34f19','<p>Earlier version of this site.&nbsp;</p>\n<p>This was the previous installment of the this website. Also constructed in Drupal, the site uses a light pallette with many diffrent tonalites of orange. The design was intended to have the utmost simplicity. All elements unnecessary were eliminated. The site is also designed to be very interactive. It&#39;s design is made so almost all actions made by the user are somehow responded upon.&nbsp;</p>\n',1301755781,1301669381,'',0),('2:fb940da2bab4004096c2e97ee2c675ca','<p>Series of posters done to promote internships.</p>\n',1303176585,1303090185,'',0),('1:ff65e795b655247597f401fe9e1c727f','<p>Logo done for AIESEC Ro Piedras local commitee.This logo was designed with the idea of a single line constituting the whole logo. At the same time, the logo appears and disappears. The whole logo shows itself through the discountinuity of a line, and the whole image of the organisation through this ephemerality.</p>\n',1303176585,1303090185,'',0);
