INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES (20,20,1,'Iberoamerican Leadership Congress Logo','<p>Logo designed for the Iberoamerican Leadership Congress 2011, held in Puerto Rico. <!--break--></p><p>The logo was designed with the utmost simplicity in mind. The logo consists in only one line that contructs the whole logo (and idea also develpod in another proyect). The typography surrounds the logo, to keep up with it&#39;s linear form. The &quot;garita&quot; was used as a way to give a visual representation to a conference based on the very abstract notion of &#39;leadership&#39; (hard to represent visually), using the national symbol instead.</p>','<p>Logo designed for the Iberoamerican Leadership Congress 2011, held in Puerto Rico. ','',1292365976,2),(21,21,1,'Sal del salon!','<p>Series of posters to promote internships.</p><p>Through these posters, designed for a campaign to promote internation internships in education. The material was designed to draw viewers attention thru the use of pictures, BIG NICE GOOD pictures. The idea was to lure thru the seductivness of the international imagery. Taking the images as the most important element in the design, the typography, it&#39;s messages, and the institutional branding were designed acordingly.</p><p>A lot of attention was addressed towards the relationships between all the diffrente materials. Thru the format and typography, the similarities were empathized. Thru the colors and some spacial accomodations the diffrences were rescued.</p>','<p>Series of posters to promote internships.</p><p>Through these posters, designed for a campaign to promote internation internships in education. The material was designed to draw viewers attention thru the use of pictures, BIG NICE GOOD pictures. The idea was to lure thru the seductivness of the international imagery. Taking the images as the most important element in the design, the typography, it&#39;s messages, and the institutional branding were designed acordingly.</p>','',1292364639,2),(22,22,1,'Talent Management','<p>Logo designe for AIESEC Puerto Rico&#39;s talent management team. <!--break--></p><p>The Talent Management Team inside this organization (AIESEC) is responsible for dealign with providing the correct experience for all members. Taking the the team&#39;s role in the organization, a logo was designed taking in the idea of &#39;building&#39; and the &#39;sum of the parts&#39; to give the entity an aesthetically pleasing image. Simple elementary colors were used to denote the contrast of the forms, while empathizing the structural unity (related to the idea of the organizational unity the entity itends to provide). Lastly, a very expressive but clear typograhpy was used to balance the rest of the composition.</p>','<p>Logo designe for AIESEC Puerto Rico&#39;s talent management team. ','',1292366436,2),(23,23,1,'Communications Logo','Logo designed for AIESEC Communications team.\r\n<!--break-->\r\n','Logo designed for AIESEC Communications team.\r\n','',1288895651,1),(24,24,1,'The Games','Simple Flyer designed for an event.\r\n<!--break-->\r\n','Simple Flyer designed for an event.\r\n','',1288895652,1),(25,25,1,'Emoticon Me. ','','','',1288895651,1),(26,26,1,'Top','','','',1288895652,1),(2,2,1,'About Me','<h2><em>This is the portfolio site of Jorge Silva.&nbsp;</em></h2><p>Here you&#39;ll find all types of work including logos, posters and websites.&nbsp;</p><p>Jorge Silva has knowledge different programs such as <em>Photoshop</em> and <em>Illustrator</em> and knowledge of how to build the web by <em>HTML, CSS, Flash( unfortunately, for such a firm believer in standards</em><em>), &nbsp;PHP, </em>&nbsp;and trough different CMSs like (<em>Wordpress, Joomla, Drupal</em>).&nbsp;</p><p>His design style aspires always to be <em><span style=\"color: rgb(105, 105, 105);\">simple</span></em>, convinced of the power of simple solutions to problems in design.</p>','<h2><em>This is the portfolio site of Jorge Silva.&nbsp;</em></h2><p>Here you&#39;ll find all types of work including logos, posters and websites.&nbsp;</p><p>Jorge Silva has knowledge different programs such as <em>Photoshop</em> and <em>Illustrator</em> and knowledge of how to build the web by <em>HTML, CSS, Flash( unfortunately, for such a firm believer in standards</em><em>), &nbsp;PHP, </em>&nbsp;and trough different CMSs like (<em>Wordpress, Joomla, Drupal</em>).&nbsp;</p>','',1292976349,2),(12,12,1,'Acreditacin - Facultad de Administracin de Empresas','','','',1288895652,1),(13,13,1,'Album Cover -  Gatoelctrico','Album cover and logo design for Gatoelectrico.','Album cover and logo design for Gatoelectrico.','',1288895652,1),(14,14,1,'Exchange Logo','<p>Logo done for <a href=\"http://www.aiesec.org/cms/aiesec/AI/Iberoamerica/PUERTO%20RICO/Estudiantes_y_Graduados/Internados_Profesionales/index.html\">AIESEC Ro Piedras&#39;</a> exchange team.</p><p>The logo was designed as a way to give an image to a tean inside the organization that focuses on arranging internships and exchange participants from all over the wold. While utilizing intricate forms and shapes, the simplest pallette was used. The logo has a &#39;rugged&#39; feel, balanced by it&#39;s outline that orders and balances the rest of the composition.</p>','<p>Logo done for <a href=\"http://www.aiesec.org/cms/aiesec/AI/Iberoamerica/PUERTO%20RICO/Estudiantes_y_Graduados/Internados_Profesionales/index.html\">AIESEC Ro Piedras&#39;</a> exchange team.</p><p>The logo was designed as a way to give an image to a tean inside the organization that focuses on arranging internships and exchange participants from all over the wold. While utilizing intricate forms and shapes, the simplest pallette was used. The logo has a &#39;rugged&#39; feel, balanced by it&#39;s outline that orders and balances the rest of the composition.</p>','',1292366449,2),(15,15,1,'Logo AIESEC Ro Piedras','<p>Logo done for AIESEC Ro Piedras local commitee.</p><p>This logo was designed with the idea of a single line constituting the whole logo. At the same time, the logo appears and disappears. The whole logo shows itself through the discountinuity of a line, and the whole image of the organisation through this ephemerality.</p><p>Since the organization is constituted by students of the University of Puerto Rico, the image of the tower was used as a way to give an image through this emblamtic building, often used to represent the university. Nevertheless, through the use of a diffrent, simpler, aesthetic the use of this architectural element was graspped by organization, instead of bein just a mere duplicate of the university&#39;s image.</p><p>.</p>','<p>Logo done for AIESEC Ro Piedras local commitee.</p><p>This logo was designed with the idea of a single line constituting the whole logo. At the same time, the logo appears and disappears. The whole logo shows itself through the discountinuity of a line, and the whole image of the organisation through this ephemerality.</p>','',1293902195,1),(16,16,1,'Flyer - Magdalane Sisters','Flyer done including information and brief introduction to the movie Magdalane Sisters.','Flyer done including information and brief introduction to the movie Magdalane Sisters.','',1288895651,1),(17,17,1,'Flyer - ARPEH','','','',1288895652,1),(18,18,1,'Good Bye Lenin!','Flyer with information and basic plot for the movie Good Bye Lenin!','Flyer with information and basic plot for the movie Good Bye Lenin!','',1288895651,1),(19,19,1,'Vete de Internado....','<p>Series of posters done to promote internships.</p><p>Three posters were designed to promote diffrent types of international internship experiences (Working with NGO&#39;s, youth empowerment programs and cultural ambassadorship programs). It was important to design a series of poster 1. Explaining all three diffrent types of internships and 2. to keep up with the organization&#39;s branding (AIESEC). This was achieved thru the use of template in which the changing elements were given more attention thru positioning, typography and color. An angled spacial organization was also used to bring tension and attention to poster.</p>','<p>Series of posters done to promote internships.</p>','',1292366131,2),(27,27,1,'TOP','aasdf','aasdf','',1288895652,1),(28,28,1,'Chatka Camp ','<p>This website was done for a the Chatka Summer camp.</p><p>The site is a very simple site, done over a year ago. The site is a basic presentation site for the camp. Because of this a very simple layout was used. The design was a combination of a redesign, taking some of the features used in the previous site and new ideas. The aesthethics of the site reference the camp brand and logo (dark yellos, light browns) while making use of the &#39;outdoors&#39; present in previous design and very portinent for this type of summer camp.</p><p>The site employs Jquery technology for galleries and tabs, animated GIFS for the menus, Flickr embeddeds and simple HTML.</p>','<p>This website was done for a the Chatka Summer camp.</p><p>The site is a very simple site, done over a year ago. The site is a basic presentation site for the camp. Because of this a very simple layout was used. The design was a combination of a redesign, taking some of the features used in the previous site and new ideas. The aesthethics of the site reference the camp brand and logo (dark yellos, light browns) while making use of the &#39;outdoors&#39; present in previous design and very portinent for this type of summer camp.</p>','',1292366422,2),(29,29,1,'InterLeacroft','<p>Website done for InterLeacroft, a proyect established in 2009 to launch and promote the Romanization of Intellectual Property.</p><p>For this emerging and daring undertaking, a website was created to showcase and present the institution and it&#39;s ideas. As such, the sites presents what the institution does, serves as a platform for trainings and courses and for spreading the ideas of this proposition thru the intituion&#39;s blog.</p><p>In terms of design, the image of the instituion was considered at all times. The pallette and typography utilized, both in the website and in the logo, serve to show the balance between the innovation inspired by what the proyect proposes and the formality intertwined in the legal tradition.</p><p>The site was created utilizing Joomla CMS technology. The technical part of the proyect was an challenge considering the necesity of having a website available in both English and Spanish. Also the site is integrated to PayPal for some e-comerece features requested by the client to book Training and enable the selling of a book.</p>','<p>Website done for InterLeacroft, a proyect established in 2009 to launch and promote the Romanization of Intellectual Property.</p><p>For this emerging and daring undertaking, a website was created to showcase and present the institution and it&#39;s ideas. As such, the sites presents what the institution does, serves as a platform for trainings and courses and for spreading the ideas of this proposition thru the intituion&#39;s blog.</p>','',1292366411,2),(30,30,1,'CC IM Application','<p>One-page website, done as an application.</p><p>For a personal application, a simple one-page website was done with simple HTML ana CSS. The site showcased very simple solid design utilizing some CSS3 technology and the Google Fonts API. The visual aspect of every detail was given very special attention to balance the simplicty of the site with the amount of content and good visual presentation.</p>','<p>One-page website, done as an application.</p><p>For a personal application, a simple one-page website was done with simple HTML ana CSS. The site showcased very simple solid design utilizing some CSS3 technology and the Google Fonts API. The visual aspect of every detail was given very special attention to balance the simplicty of the site with the amount of content and good visual presentation.</p>','',1292365904,2),(31,31,1,'NoelDavila.net','<p>Website for musician/writer Noel Davila.</p><p>After Noel Davila&#39;s frustration with his very busy webmaster, I CMS and redesign was done for noeldavila.net. The very simple and user friendly Wordpress was used to provide a solution that would empower the user to manage his own content, instead of relying on a designer. This Wordpress instaltion provides the capabilites for download management, social media channels management, quotes and Latests News.</p><p>The chance was taken to perform a redesign on the website. The site is now much more user friendly than the previous design and much more aesthetically pleasing. The colors yellow, black and grey were used to denote contrats and degrees of importance in the page.</p><p><span style=\"color: rgb(105, 105, 105);\"><em>This site is still in the design process. It will be launched January 2011, by request of the client.</em></span></p>','<p>Website for musician/writer Noel Davila.</p><p>After Noel Davila&#39;s frustration with his very busy webmaster, I CMS and redesign was done for noeldavila.net. The very simple and user friendly Wordpress was used to provide a solution that would empower the user to manage his own content, instead of relying on a designer. This Wordpress instaltion provides the capabilites for download management, social media channels management, quotes and Latests News.</p>','',1296087675,2),(32,32,1,'Iberoamerican Leadership Congress.org','<p>Site designed for the Iberoamerican Leadership Congress 2011 held in Puerto Rico.</p><p>The site as designed mostly as a portal for information related to the congress. This is mainly a content site and was designed accordingly (through it&#39;s horizontallity, through it&#39;s white background and typography). The experience is designed for the user to read. Social Media was also integrated to promote the congress among it&#39;s visitros.</p><p>The design is based on the previous logo design. The pallette utilizes diffrent&nbsp;flavos of&nbsp;blue to contrast elements in the page. Also diffrent shades of gray were used and incoporated almost as a fade of the dominant blue background. This type of light gray was used mostly to differentiate diffrent spaces in the page. The menu typography is also very intresting in how it was utilized as a way to mark both, the professional aspect of the conferencas as well as the youth of it&#39;s participants.</p><p><span style=\"color: rgb(105, 105, 105);\"><em>This site will be launched very shortly and is on the final stages of it&#39;s design.</em></span></p>','<p>Site designed for the Iberoamerican Leadership Congress 2011 held in Puerto Rico.</p><p>The site as designed mostly as a portal for information related to the congress. This is mainly a content site and was designed accordingly (through it&#39;s horizontallity, through it&#39;s white background and typography). The experience is designed for the user to read. Social Media was also integrated to promote the congress among it&#39;s visitros.</p>','',1296087711,2),(33,33,1,'theJSJ 2 ','<p>Earlier version of this site.&nbsp;</p><p>This was the previous installment of the this website. Also constructed in Drupal, the site uses a light pallette with many diffrent tonalites of orange. The design was intended to have the utmost simplicity. All elements unnecessary were eliminated. The site is also designed to be very interactive. It&#39;s design is made so almost all actions made by the user are somehow responded upon.&nbsp;</p>','<p>Earlier version of this site.&nbsp;</p><p>This was the previous installment of the this website. Also constructed in Drupal, the site uses a light pallette with many diffrent tonalites of orange. The design was intended to have the utmost simplicity. All elements unnecessary were eliminated. The site is also designed to be very interactive. It&#39;s design is made so almost all actions made by the user are somehow responded upon.&nbsp;</p>','',1296087532,2),(34,34,1,'September 26','<p>&quot;No art, however minor, demands less than total dedication if you want to excel in it&quot;</p>','<p>&quot;No art, however minor, demands less than total dedication if you want to excel in it&quot;</p>','',1294881766,2),(35,35,1,'November 25','','','',1294882894,1);
