INSERT INTO `node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES ('page','Page','node','A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an \"About us\" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site\'s initial home page.','',1,'Title',1,'Body',0,1,1,0,'page'),('story','Story','node','A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site\'s initial home page, and provides the ability to post comments.','',1,'Title',1,'Body',0,1,1,0,'story'),('portfoilio_item_h','Portfolio Item Horizontal Picture','node','Portfolio Item.','',1,'Title',1,'Body',0,1,1,0,''),('book','Book page','node','A <em>book page</em> is a page of content, organized into a collection of related entries collectively known as a <em>book</em>. A <em>book page</em> automatically displays links to adjacent pages, providing a simple navigation system for organizing and reviewing structured content.','',1,'Title',1,'Body',0,1,1,0,'book'),('blog','Blog entry','blog','A <em>blog entry</em> is a single post to an online journal, or <em>blog</em>.','',1,'Title',1,'Body',0,0,0,1,'blog'),('portfoilio_item_v','Portfolio Item Vertical','node','Portfolio Item with an image of large Height than Width ','',1,'Title',1,'Body',0,1,1,0,'');
