 intertwined in the legal tradition the site was created utilizing joomla cms technology the technical part of the proyect was an challenge considering the necesity of having a website available in both english and spanish also the site is integrated to paypal for some ecomerece features requested by the client to book training and enable the selling of a book visit site project image  logo portfolio web  ',0),(28,'node',' chatka camp this website was done for a the chatka summer camp the site is a very simple site done over a year ago the site is a basic presentation site for the camp because of this a very simple layout was used the design was a combination of a redesign taking some of the features used in the previous site and new ideas the aesthethics of the site reference the camp brand and logo dark yellos light browns while making use of the outdoors present in previous design and very portinent for this type of summer camp the site employs jquery technology for galleries and tabs animated gifs for the menus flickr embeddeds and simple html visit site project image  portfolio web  ',0),(22,'node',' talent management logo designe for aiesec puerto rico s talent management team the talent management team inside this organization aiesec is responsible for dealign with providing the correct experience for all members taking the the team s role in the organization a logo was designed taking in the idea of building and the sum of the parts to give the entity an aesthetically pleasing image simple elementary colors were used to denote the contrast of the forms while empathizing the structural unity related to the idea of the organizational unity the entity itends to provide lastly a very expressive but clear typograhpy was used to balance the rest of the composition project image  logo portfolio  ',0),(14,'node',' exchange logo logo done for aiesec ro piedras  exchange team the logo was designed as a way to give an image to a tean inside the organization that focuses on arranging internships and exchange participants from all over the wold while utilizing intricate forms and shapes the simplest pallette was used the logo has a rugged feel balanced by it s outline that orders and balances the rest of the composition project image  logo portfolio  ',0),(15,'node',' logo aiesec ro piedras logo done for aiesec ro piedras local commiteethis logo was designed with the idea of a single line constituting the whole logo at the same time the logo appears and disappears the whole logo shows itself through the discountinuity of a line and the whole image of the organisation through this ephemeralitysince the organization is constituted by students of the university of puerto rico the image of the tower was used as a way to give an image through this emblamtic building often used to represent the university nevertheless through the use of a diffrent simpler aesthetic the use of this architectural element was graspped by organization instead of bein just a mere duplicate of the university s image project image  portfolio  ',0),(2,'node',' about me this is the portfolio site of jorge silva  here you ll find all types of work including logos posters and websites jorge silva has knowledge different programs such as photoshop and illustrator and knowledge of how to build the web by html css flash unfortunately for such a firm believer in standards  php   and trough different cmss like  wordpress joomla drupal  his design style aspires always to be simple  convinced of the power of simple solutions to problems in design  ',0),(32,'node',' iberoamerican leadership congressorg site designed for the iberoamerican leadership congress 2011 held in puerto rico the site as designed mostly as a portal for information related to the congress this is mainly a content site and was designed accordingly through it s horizontallity through it s white background and typography the experience is designed for the user to read social media was also integrated to promote the congress among it s visitros the design is based on the previous logo design the pallette utilizes diffrent flavos of blue to contrast elements in the page also diffrent shades of gray were used and incoporated almost as a fade of the dominant blue background this type of light gray was used mostly to differentiate diffrent spaces in the page the menu typography is also very intresting in how it was utilized as a way to mark both the professional aspect of the conferencas as well as the youth of it s participants this site will be launched very shortly and is on the final stages of it s design visit site project image  portfolio web  ',0),(31,'node',' noeldavilanet website for musician writer noel davila after noel davila s frustration with his very busy webmaster i cms and redesign was done for noeldavilanet the very simple and user friendly wordpress was used to provide a solution that would empower the user to manage his own content instead of relying on a designer this wordpress instaltion provides the capabilites for download management social media channels management quotes and latests news the chance was taken to perform a redesign on the website the site is now much more user friendly than the previous design and much more aesthetically pleasing the colors yellow black and grey were used to denote contrats and degrees of importance in the page this site is still in the design process it will be launched january 2011 by request of the client visit site project image  portfolio web  ',0),(33,'node',' thejsj 2 earlier version of this site this was the previous installment of the this website also constructed in drupal the site uses a light pallette with many diffrent tonalites of orange the design was intended to have the utmost simplicity all elements unnecessary were eliminated the site is also designed to be very interactive it s design is made so almost all actions made by the user are somehow responded upon  visit site project image  portfolio